pragma solidity >=0.4.21 <0.7.0;

import "../libs/openzeppelin-solidity/contracts/ownership/Ownable.sol";

contract SickFactory is Ownable {
    event NewSick(uint256 sickId, string name, uint256 sickCode);

    struct Sick {
        string name;
        uint256 sickCode; //ma benh
    }

    Sick[] public sicks;

    modifier isSick(uint256 _sickCode) {
        uint256 a = 0;
        for (uint256 i = 0; i < sicks.length; i++) {
            if (sicks[i].sickCode == _sickCode) a++;
        }
        require(a == 1);
        _;
    }

    function _createSick(string memory _name, uint256 _sickCode)
        public
        onlyOwner
    {
        uint256 id = sicks.push(Sick(_name, _sickCode)) - 1;
        emit NewSick(id, _name, _sickCode);
    }

    function _countSick() public view returns (uint256) {
        return sicks.length;
    }

}
